defmodule ImaginativeRestoration.SketchTest do
  use ImaginativeRestoration.DataCase

  describe "Sketch resource" do
    @describetag timeout: :timer.minutes(10)

    test "can be created (inc. processing on Replicate)" do
      unprocessed = image_dataurl()
      assert {:ok, sketch} = ImaginativeRestoration.Sketches.process(unprocessed)
      assert sketch.unprocessed == unprocessed
      assert sketch.model == "adirik/t2i-adapter-sdxl-canny"
      refute is_nil(sketch.processed)
      refute is_nil(sketch.prompt)
    end
  end

  # note: this is from a real shot from the camera
  defp image_dataurl do
    "data:image/jpeg;base64,"
  end
end
